import {LOAD_DATA_SUCCESS, LOAD_DATA_FAILURE} from "../actions/users";



 export default function(state=initialState , actions) {

 switch(actions.type) {

    case LOAD_DATA_SUCCESS:
        return Object.assign({}, state, {
        data: actions.data,
      });
      case LOAD_DATA_FAILURE:
        return actions.err
          default:
            return state;
                }




 }
